import React, { useState } from 'react';
import HomePage from './components/homepage.js';
import Dashboard from './components/Dashboard.js';
import GradeReportPage from './components/GradeReportPage.js';
import MissingGradeFormPage from './components/MissingGradeFormPage.js';
import InstructorContactPage from './components/InstructorContactPage.js';
import LoginPage from './components/LoginPage';
import HelpAndSupportPage from './components/HelpAndSupportPage.js';

const App = () => {
  const [currentPage, setCurrentPage] = useState('homepage');

  const handlePageChange = (pageName) => {
    setCurrentPage(pageName);
  };

  let pageContent;

  switch (currentPage) {
    case 'homepage':
      pageContent = <HomePage />;
      break;
    case 'dashboard':
      pageContent = <Dashboard />;
      break;
    case 'grade-reporting':
      pageContent = <GradeReportPage />;
      break;
    case 'missing-grades':
      pageContent = <MissingGradeFormPage />;
      break;
    case 'instructor-contact':
      pageContent = <InstructorContactPage />;
      break;
    case 'login':
      pageContent = <LoginPage />;
      break;
    case 'help-and-support':
      pageContent = <HelpAndSupportPage />;
      break;
    default:
      pageContent = <div>Page not found</div>;
  }

  return (
    <div>
      {/* Your navigation bar or any other component for changing pages */}
      <nav>
        <button onClick={() => handlePageChange('homepage')}>Home</button>
        <button onClick={() => handlePageChange('dashboard')}>Dashboard</button>
        {/* Add buttons or links for other pages */}
      </nav>

      {/* Render the content based on the current page */}
      {pageContent}
    </div>
  );
};

export default App;
